import { Component, Input } from '@angular/core';
import { ParentUser } from '../parent-user';
import { AppComponent } from '../app.component';
import { NgFor, NgIf, JsonPipe, CommonModule } from '@angular/common';

@Component({
  selector: 'app-user',
  standalone:true,
  imports: [AppComponent,NgFor,NgIf,JsonPipe,CommonModule],
  // templateUrl: './user.component.html',
  template: `
  <div *ngFor="let parentUser from parentUsersImport">{{parentUser|json}}</div>
  `,
  styleUrls: ['./user.component.css']
})
export class UserComponent {
  @Input({required:true}) parentUsersImport!:ParentUser[];
}
